import React from 'react';


const GenesisGift = ({
                        title,
                        description,
                        isLast
                     }) => {
    return (
        <div className={
            isLast
                ? "col-12 col-md-6 col-lg-4 padding-top-bottom-activity"
                : "col-12 col-md-6 col-lg-4 padding-top-bottom-activity padding-top-bottom-mobile"
        }>
            <div className="row">
                <div className="col-12">
                    <p className="genesis-top font-weight-500">{title}</p>
                </div>
            </div>
            <div className="row ">
                <div className="col-12">
                    <div className={"border-bottom-genesis"}/>
                </div>
            </div>
            <div className="row">
                <div className="col-12">
                    <p className="title-small-block-text font-weight-400">{description}</p>
                </div>
            </div>
        </div>
    );
};

export {
    GenesisGift as default
}
